import React from 'react';
import { Navbar, Nav, Carousel } from 'react-bootstrap';

import messi from './messi.jpg';
import ron from './ron.jpeg';
import salah from './salah.jpg';


export class Content extends React.Component {

    render() {
        return (
            <Carousel>
            <Carousel.Item>
              <img
                className="d-block w-100"
                img src={messi} 
                alt="First slide"
                height = "700px"
                width = "600px"
              
              />
     
              <Carousel.Caption>
              <h3>Fantasy World X1</h3>
                <p>Pick your  best XI players in the world right now</p>
              
              </Carousel.Caption>
              
            </Carousel.Item>
            <Carousel.Item>
              <img
                className="d-block w-100"
                src={ron}
                alt="Second slide"
                height = "700px"
                width = "600px"
              />
          
              <Carousel.Caption>
              <h3>Add and delete players Weeky</h3>
                <p>If players are having a bad week you can always replace them</p>
              </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
              <img
                className="d-block w-100"
                src={salah}
                alt="Second slide"
              />
          
              <Carousel.Caption>
              <h3>Compare with friends</h3>
                <p>Show your team off to your mates</p>
              </Carousel.Caption>
            </Carousel.Item>
          </Carousel>
          
        );
    }
}
